    private

      def self.name(user)
        (user.name && !user.name.blank? ? user.name : user.username).titleize
      end

      def self.logo_group(size, width, height)
        begin
          uri = URI(SiteSetting.logo_small_url)

          logo_uri =
            if uri.host.blank? || uri.scheme.blank?
              URI("#{Discourse.base_url}/#{uri.path}")
            else
              uri
            end

          <<~URL
          <g transform="translate(#{width / 2 - (size / 2)} #{height})">
            <image height="#{size}px" width="#{size}px" xlink:href="data:image/png;base64,#{Base64.strict_encode64(logo_uri.open('rb', redirect: true, allow_redirections: :all).read)}"/>
          </g>
          URL
        rescue URI::InvalidURIError
          ''
        end
      end

      def self.avatar_url(user)
        UrlHelper.absolute(user.avatar_template.gsub('{size}', '250'))
      end
